import React, { Component } from "../../../../Library/Caches/typescript/2.9/node_modules/@types/react";
import { BrowserRouter as Router, Switch, Route, withRouter,Redirect } from "../../../../Library/Caches/typescript/2.9/node_modules/@types/react-router-dom";

import ShipmentDetailsLogin from "./Layouts/Pages/ShipmentDetails";
import ShipmentDetailsNotLogin from "./Layouts/Pages/Track";
import * as actions from './store/actions';
import StorageUtil from "./utils/storageUtil";

import logo from './logo.svg';
import './App.css';

// function App() {
//   return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
//   );
// }

// export default App;


class App extends Component {

	componentDidMount() {
		this.props.onTryAutoSignup();
	}


	render() {

		return (
			<Router basename="/">

				<Layout isAuthenticated = {this.props.isAuthenticated}>
					{this.props.isAuthenticated && StorageUtil.getUser() !== null ?
						<Switch>
							<Route exact path="/" component={withRouter(Arrive)} />
							<Route exact path="/arrive" component={withRouter(Arrive)} />
							<Route exact path="/ratesearchadmin" component={withRouter(SearchAdminRate)} />
							<Route exact path="/ratesearchuser" component={withRouter(SearchUserRate)} />

							<Route exact path="/searchcontract" component={withRouter(SearchContract)} />
							<Route exact path="/managecontract" component={withRouter(ManageContract)} />

							<Route exact path="/raterule" component={withRouter(RateRule)} />

							<Route path="/login" component={Login} />
							<Route path="/settings-account" component={withRouter(SettingsAccount)} />
							<Route path="/settings-location-info" component={withRouter(SettingsLocationInfo)} />
							<Route path="/settings-locations" component={withRouter(SettingsLocations)} />
							<Route path="/settings-user-edit" component={withRouter(SettingsUserEdit)}/>
							<Route path="/settings-user-list" component={withRouter(SettingsUserList)} />
							<Route path="/shipment-details" component={withRouter(ShipmentDetailsLogin)}/>
							<Route path="/search-accessorial" component={withRouter(AccessorialSearch)} />
							<Route path="/fuel-surcharge" component={FuelSurcharge} />

							<Route path="/logout" component={Logout} />
							<Route path="/dashboard" component={withRouter(Dashboard)} />
						<Route path="/dashboard-edit" component={DashboardEdit} />
						<Route path="/dashboard-chartview/:dashId" component={DashboardChartVeiw} />
						<Route path="/single-dashboard/" component={DashboardSingle} />
							<Redirect to="/" />
						</Switch>
						:
						<Switch>
							<Route path="/auth" component={Login} />
							<Route path="/" exact component={Login} />
							<Route path="/shipment-track" component={withRouter(ShipmentDetailsNotLogin)} />
         					<Redirect to="/" />
						</Switch>

					}

				</Layout>

			</Router>
		);
	}

}


const mapStateToProps = state => {
	return {
		isAuthenticated: state.auth.token !== null,
		isInboxOpen: false
	};
};

const mapDispatchToProps = dispatch => {
	return {
		onTryAutoSignup: () => dispatch(actions.authCheckState())
	};
};

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(App));
